     return (
         <div className="row text-capitalize text-center">
             <div className="col-10 mx-auto col-lg-2">
                 <img src={img} 
                      style={{width:'5rem', height:"5rem"}} 
                      className="img-fluid"
                      alt="product"
                  />
             </div>
             <div className="col-10 mx-auto col-lg-2">
                 <span className="d-lg-none">
                     product : 
                 </span>
                 {title}
             </div>

         </div>


     ) 

}
